import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  const handleRegisterClick = () => {
    navigate('/inscription');
  };

  return (
    <div className="home-container">
      <div className="hero-section">
        <h2>Bienvenue sur TawjihiBot</h2>
        <p>Votre assistant pour l'orientation académique et professionnelle</p>
        <button onClick={handleRegisterClick} className="cta-button">
          Créer un compte
        </button>
      </div>

      <div className="features-section">
        <div className="feature-card">
          <h3>Chatbot Intelligent</h3>
          <p>Obtenez des réponses personnalisées à vos questions d'orientation</p>
        </div>
        <div className="feature-card">
          <h3>Informations sur les Filières</h3>
          <p>Découvrez les différentes options d'études disponibles</p>
        </div>
        <div className="feature-card">
          <h3>Guide d'Inscription</h3>
          <p>Accompagnement pour l'inscription dans les établissements</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
